import './App.css';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import { Header } from './components/Header';
import { productsData } from './api/Api';

function App() {
  const Layout = ()=>{
    return <div>
      <Header/>
      {/* <ScrollRestoration/>
      <Outlet/>
      <Footer/> */}
    </div>
  }

  const router = createBrowserRouter([
    {
      path:'/',
      element: <Layout/>,
      children:[
        {
          path: '/',
          element: <Home/>,
          loader: productsData
        },
      ]
    }
  ]) 

  return (
    <div className="App">
           <RouterProvider router={router}/>
    </div>
  );
}

export default App;
